import React from 'react';
import ReactDOM from 'react-dom';
import { createStore, applyMiddleware, compose } from 'redux';
import mainReducer from '../reducers/databaseReducer';
import {BrowserRouter} from 'react-router-dom';
import { Provider } from 'react-redux';
import thunkMiddleware from 'redux-thunk'
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import configureStore from './store/configureStore.js'

// const store = configureStore();
let preloadedState =  {};
	if (window.__STATE__) {
		preloadedState = window.__STATE__;
		delete window.__STATE__;
  }
  // Подключение Redux Dev Tools, на боевом сайте отключена запись действий
	const composeEnhancers = typeof window === 'object' &&
  window.__REDUX_DEVTOOLS_EXTENSION_COMPOSE__ ?  window.__REDUX_DEVTOOLS_EXTENSION_COMPOSE__({
    shouldRecordChanges: ENVIRONMENT === 'development' // eslint-disable-line
  }) : compose;
const enhancer = composeEnhancers(applyMiddleware(
  thunkMiddleware,
));
let store = createStore(
  mainReducer,
  preloadedState,
  enhancer
);
ReactDOM.render(
  <Provider store={store}>
    <BrowserRouter>
						<App />
					</BrowserRouter>
  </Provider>,
  document.getElementById('root')
)

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
